        "Description": "乐视云计算有限公司（以下简称乐视云）致力创建和共享围绕生活、商业、社会的全球云生态，打造垂直整合的EaaS（生态即服务，Eco-as-a-Service）云模式，重构产业链价值。乐视云围绕VaaS（Video-as-a-Service，视频即服务），面向IaaS、PaaS、SaaS启动全云布局，在全球范围提供6大VaaS场景：云资源（CDN、云存储）、云视频（云直播、云版权、云点播、视频处理）、云数据的视频云产品系。基于覆盖全球60多个国家和地区的750个CDN节点、30Tbps出口带宽，乐视云实现全年千万场云直播、日均亿级终端动态加速、实时高清千万级并发，覆盖数十亿用户。此外乐视云全面支持 4K 、360度全景、VR实时直播、H.265等新一代视频技术，是全球首个基于产业链垂直整合、全面开放的跨行业、全终端视频云服务生态系统创立者。目前，乐视云成功服务于除乐视外上万家企业客户，如熊猫TV、战旗TV、快手、人人网、凤凰网、百度视频等互联网企业；在广电领域，乐视云先后与中国蓝TV、天府TV、四川网络广播电视台等广电企业建立开放型战略合作，促进新型全媒体产业融合；乐视云发行渠道覆盖乐视视频、乐视超级手机、乐视超级电视等乐视全屏，以及Facebook、YouTube、中国蓝TV、华数、CIBN国广东方等全球互联网、广电、户外众多渠道；乐视云官方网站服务十余万家互联网客户、创业企业及开发者，且数量持续快速增长。在全球化战略上，乐视云与微软、英特尔、爱立信、戴尔及全球主要运营商展开深入战略合作，全面加速全球化的云生态建设落地。 2016年3月3日，乐视云成功完成A轮融资，融资金额为10亿元人民币，成为全球云计算产业中首轮融资金额最大的公司。未来，乐视云将持续为用户、行业及社会创造前所未有的生态价值。",
