        "Markedman": "贾跃亭",
        "Violation": "一、股份减持信息披露违规(一)2018年9月19日,乐视网披露《关于大股东股票质押违约处置的预披露公告》。2018年9月28日至10月18日,贾跃亭被质权人通过集中竞价交易强制平仓减持乐视网股份2,221.85万股,占乐视网总股本的0.56%,涉及金额8,228.01万元,上述减持距离预披露日期不足15个交易日。(二)2019年1月15日,乐视网披露《关于大股东股票质押违约处置的预披露公告》。2019年1月18日至2月12日,贾跃亭被质权人通过集中竞价交易强制平仓减持乐视网股份1,378.02万股,占乐视网总股本的0.34%,涉及金额3,582.83万元,上述减持距离预披露日期不足15个交易日。二、敏感期交易(一)2018年10月8日、10月9日,贾跃亭被质权人通过集中竞价交易强制平仓减持乐视网股份918.02万股,占乐视网总股本的0.23%,涉及金额3,349.19万元。乐视网于2018年10月12日披露《2018年前三季度业绩预告》,上述减持发生在业绩预告公告前十日内。(二)2019年1月21日至1月30日,贾跃亭被质权人通过集中竞价交易强制平仓减持乐视网股份350.81万股,占乐视网总股本的0.09%,涉及金额927.07万元。乐视网于2019年1月31日披露《2018年度业绩预告》,上述减持发生在业绩预告公告前十日内。(三)2019年2月18日至2月27日,贾跃亭被质权人通过集中竞价交易强制平仓减持乐视网股份147.80万股,占乐视网总股本的0.04%,涉及金额403.14万元。乐视网于2019年2月28日披露《2018年度业绩快报》,上述减持发生在业绩快报公告前十日内。(四)2019年3月26日至4月25日,贾跃亭被质权人通过集中竞价交易强制平仓减持乐视网股份2,231.86万股,占乐视网总股本的0.56%,涉及金额5,924.99万元。乐视网于2019年4月26日披露《2018年年度报告》,上述减持发生在年度报告公告前三十日内。",
