        "Markedman": "贾跃亭",
        "Violation": "(一)控股股东关联方资金占用乐视网2017年年度报告显示,2017年度贾跃亭关联方非经营性资金占用发生额为15.59亿元,期末余额为9.31亿元;2018年年度报告显示,2018年度贾跃亭关联方非经营性资金占用发生额为2.2亿元,期末余额为4.91亿元。(二)违规担保乐视网2018年4月18日、6月4日、7月9日披露的公告显示,乐视网2015年度、2016年度存在未履行审议程序和信息披露义务为贾跃亭关联方提供担保的情形。根据乐视网、乐视体育文化产业发展(北京)有限公司(以下简称“乐视体育”,贾跃亭控制的企业)、贾跃亭、乐视体育A轮及A+轮投资方于2015年4月27日及2016年4月11日签署的《乐视体育文化产业发展(北京)有限公司股东协议》,若乐视体育无法在2018年12月31日前上市,乐视网与乐视体育原股东将共同承担回购义务。此外,根据乐视控股(北京)有限公司(以下简称“乐视控股”,贾跃亭控制的企业)、贾跃亭、重庆战略性新兴产业乐视云专项股权投资基金合伙企业(有限合伙)(以下简称“乐视云基金”)签署的《股权收购及担保合同》,若乐视云计算有限公司(以下简称“乐视云”)无法在2016年、2017年、2018年完成合同约定的经营指标或在2019年初上市,乐视控股及贾跃亭将向乐视云基金履行回购义务。乐视网签署了《承诺函》,对乐视控股在《股权收购及担保合同》项下的收购义务提供连带保证担保。(三)财务报告被出具无法表示意见乐视网2017年度财务报告被立信会计师事务所(特殊普通合伙)出具了无法表示意见的审计报告,主要原因是对乐视网应收账款和其它应收款计提坏账准备的准确性、无形资产减值的合理性以及期末应付服务商暂估款等无法获取充分、适当的审计证据,不能确定是否存在重大错报,也无法判断是否明显违反会计准则等相关规定。(四)2016年度业绩预计违规2017年1月26日,乐视网披露2016年度业绩预告,预计2016年度归属于上市公司股东的净利润(以下简称“净利润”)为63,032.99万元-77,358.67万元。2017年2月27日,乐视网披露2016年度业绩快报,预计2016年度净利润为76,554.81万元。2017年4月19日,乐视网披露2016年年度报告,2016年度经审计净利润为55,475.92万元。乐视网2016年度业绩预告、业绩快报披露的净利润与年度报告相比,存在重大差异且未及时修正。(五)2018年度业绩预计违规2019年1月30日,乐视网披露2018年度业绩预告,预计2018年度净利润为亏损60,814.59万元-61,314.59万元。2019年2月27日,乐视网披露2018年度业绩快报,预计2018年度净利润为亏损202,573.97万元。2019年4月26日,乐视网披露2018年年度报告,2018年经审计净利润为亏损409,561.94万元。乐视网2018年度业绩预告、业绩快报披露的净利润与年度报告相比,存在重大差异且未及时修正。(六)募集资金使用违规2016年8月至11月,乐视网通过西藏乐视网信息技术有限公司(以下简称“西藏乐视”)使用募集资金购买版权时,西藏乐视将募集资金陆续转入乐视网一般账户,用于支付员工工资、税费结算等非募投项目支出,涉及的募集资金累计88,102万元,于2016年末全部归还。乐视网未就上述事项及时履行审议程序和信息披露义务,直到2017年4月19日才经董事会审议并对外披露,并于2017年6月28日经股东大会审议通过。",
